// import { render } from "@testing-library/react";
import React, { Component, useState } from "react";
import MainNavigation from "../Components/Layout/MainNavigation";
import "./Profile.css";
const[Username, Password] = useState=("");
var wow = false;
const users = new Map();
users.set("test", "password");
class AccountPage extends Component{
  render(){
    return (
      <h1>
        Hello Account Owner!
      </h1>
    );
  }
}
function Trial(){

      if(wow)
        <AccountPage/>
      else
        <LogIn/>

}

class LogIn extends Component{
  render(){
    return (
      <React.Fragment>
        <div class="split left">
          <div class="centered">
            <h1>Welcome !</h1>
            <h3>Already have an account ?</h3>
            <input
              type="text"
              id="user-name"
              class="input-box"
              placeholder="User Name"
            ></input>
            <br></br>
            <br></br>
            <input
              type="password"
              id="user-pass"
              class="input-box"
              placeholder="Password"
            ></input>
            <br></br>
            <br></br>
            <button id="loginButton" onClick={checkAccount}>
              Log in!
            </button>
          </div>
        </div>

        <div class="split right">
          <div class="centered">
            <h1>Welcome !</h1>
            <h3>No Account? Sign up!</h3>
            <input
              type="text"
              id="newuser-name"
              class="input-box"
              placeholder="User Name"
            ></input>
            <br></br>
            <br></br>
            <input
              type="password"
              id="newuser-pass"
              class="input-box"
              placeholder="Password"
            ></input>
            <br></br>
            <br></br>
            <button id="signupButton" onClick={createAccount}>
              {" "}
              Sign Up
            </button>
          </div>
        </div>
      </React.Fragment>
    );
  }
}
function createAccount(event) {
  //Need to check if userName has already been created

  const userName = document.getElementById("newuser-name").value;
  const password = document.getElementById("newuser-pass").value;
  if (users.has(userName)) console.log("Username already taken!");
  else users.set(userName, password);

  console.log(users.entries());
}

function checkAccount(event) {
  var userName = document.getElementById("user-name").value;
  var password = document.getElementById("user-pass").value;
  if (users.get(userName) === password) console.log("Here!"); //log in
  else console.log("Not here");
}

export default Trial;
function Account(){
  if(!wow){
    return (
      <>
        <MainNavigation/>
        <LogIn/>
      </>
    )
  }
  else{
    return (
      <>
        <AccountPage/>
      </>
    )
  }
}
function ProfilePage() {
  return (
    <React.Fragment>
      <div class="split left">
        <div class="centered">
          <h1>Welcome Back!</h1>
          <h3>Already have an account ?</h3>
          <input
            type="text"
            id="user-name"
            class="input-box"
            placeholder="User Name"
          ></input>
          <br></br>
          <br></br>
          <input
            type="password"
            id="user-pass"
            class="input-box"
            placeholder="Password"
          ></input>
          <br></br>
          <br></br>
          <button id="loginButton" onClick={checkAccount}>
            Log in!
          </button>
        </div>
      </div>

      <div class="split right">
        <div class="centered">
          <h1>Welcome !</h1>
          <h3>No Account? Sign up!</h3>
          <input
            type="text"
            id="newuser-name"
            class="input-box"
            placeholder="User Name"
          ></input>
          <br></br>
          <br></br>
          <input
            type="password"
            id="newuser-pass"
            class="input-box"
            placeholder="Password"
          ></input>
          <br></br>
          <br></br>
          <button id="signupButton" onClick={createAccount}>
            {" "}
            Sign Up
          </button>
        </div>
      </div>
    </React.Fragment>
  );
}
